import React from 'react';
import { Link } from 'react-router-dom';
import logo from './C:\Users\E15\FYP frontend\public/logo.png'; // Ensure you have the correct path to your logo file

const MainPage = () => {
  return (
    <div className="main-container">
      <img src={logo} alt="Tawlet Logo" style={{ maxWidth: '150px' }} /> // Adjust the maxWidth to fit your design
      <h1>Welcome to Tawlet Admin Portal</h1>
      <Link to="/add" className="action-button">Add a New Restaurant</Link>
      <Link to="/list" className="action-button">See All Restaurants</Link>
    </div>
  );
};

export default MainPage;
